import React from 'react';
import Tag from './Tag';

class TagList extends React.Component {

    render(){
        // return a list of tag components
        return this.props.tags.map((tag) => (
            <Tag
                key={tag.id}
                tag={tag} 
                deleteTag={this.props.deleteTodo}
            />
        ))
    }
}

export default TagList;
